import Logo from '../assets/Logo.svg';
import React, { userState } from 'react';

function LoginPage({ Login, error}) {
  const [details, setDetails] = userState({name: "", password: ""});
  const submitHandler = e => {
    e.preventDefault();
    Login(details)
  }

  return (
    <div className="LoginPage">
      <div className="container">
          <div className="row login-page-center">
              <div className="col-md-4 mx-auto">
                  <div className="mainLogo">
                      <img src={Logo} alt="Logo"/>
                  </div>   
                  <form onSubmit={submitHandler}>
                    <div className="form-group">
                        <input type="username" className="form-control login-form-input-margin" id="username" name="username" rel="username" placeholder="Username"/>
                    </div>
                    <div className="form-group">
                        <input type="password" className="form-control login-form-input-margin" id="password" name="password" rel="password" placeholder="Password"/>
                    </div>
                      <button type="submit" className="btn btn-primary btn-color w-100">Log in</button>
                </form>
              </div>
          </div>
      </div>
    </div>
  );
}

  export default LoginPage;
